[u"Finance Accounting Operation Manager
State Street Bank &Trust Company/ State Street Corporation
January 1980 to January 2018
Accounting clerk to Accounting Manager Vice President)

Progressive 38 years of experience of deploying and retiring various reconcilement systems, performing manual and automated reconcilements, analyze and automate manual reconcilements and managing and handling Reconciliation and various reconciliation systems, processing and managing of Audit Confirmations and Unclaimed/ Abandoned property filing for State Street to all North America jurisdictions.

● Implemented/deployed and retired various reconcilement systems - Fastmatch, Due Rec, ReconPlus and Frontier.
● Provided accurate and timely assessment of automation eligibility and ensured successful migration of eligible recons to Frontier
● Prepared and reviewed functional specs for Frontier automation, enhancements and interface projects.
● Collaborated with business partners to identify recon automation opportunities
● Resolved escalated inquiries, issues and communication
● Obtained and maintained the Frontier system knowledge. As SME, assisted with Frontier application deployment, set up, administration, support, resolution of production system issue including communication with vendor and IT.
● Oversee review and approval of daily reconciliations and assisted in the research and monitoring of exceptions and communicated and/or escalated exceptions/open items needing resolution with internal or external clients for timely resolution of open items
● Provide support for internal and external audits and inquiries.
● Maintain compliance with relevant laws and regulatory requirements of 55 North American jurisdictions and timely completed Unclaimed/Abandoned Property filing
● Support various Business Units around the globe, multiple time zones and cultures. And managed timelines with stakeholders and team members to have all projects completed on or prior to deadline regardless of availability of resources.
● Ensure all risk and compliance related tasks are completed timely and accurately ( ISRMP, SOX, Access reviews, Business Continuity Plan )
● Ensure effective controls are in place for all department functions (recon, audit confirmation, and Abandoned Property) to reduce and mitigate risk
● Developed, produced and monitored/managed monthly reporting and scorecards to track business unit's work performance and processed volume to identify any additional resource needs.
● Developed specs for various data source feeds to General ledger recon projects.
● Involved with deployment of new data source system to General ledger and provide recons support which includes supporting testing in UAT and DEV environments and provide sign off for deployment in production.
● Managed/oversee a team of 3 -14 people onshore and offshore thru delegation of workflow, personnel evaluation, and career development.
● Maintain functional knowledge of Frontier/Automated Recon System, overall process, and operating model;
● Maintain and improve end-to-end recon, Audit confirmation, and ABP escheatment process and customer satisfaction (internal and external);
● Ensure that teams have the resources, authority, and support needed to achieve their goals;
● Ensure all open items are cleared timely. If not, ensure they are escalated to the appropriate chain of command;
● Drive and/or support process improvement (system upgrades, patches) as necessary;
● Developed and implemented new ideas/process for efficiency gain and reduce or mitigate risk;
● Encouraged creative thinking to generate ideas for improvement and avoid duplication;
● Developed cross-training, ensured accuracy and executed against pre-determined deadlines in accordance with established procedures;
● Responsible for keeping abreast of all processes (recon, Audit Confirm, escheatment) that are not current and devise plan to bring them current;
● Identifying any unusual or potentially suspicious transaction activity and report and/or escalate in accordance with corporate policy and guidelines;
● Completed and delivered Personal Performance Reviews of staff members on time. Provided coaching and development opportunities to staff; assisted and recommended promotions, salary increases, and bonuses,"]

